        event.preventDefault();
        
    }

        return(
            <form onSubmit={this.handleSubmit}>
                <label>
                Email :
                <input type="text"
                value={this.state.value}
                onChange={this.handleChange} />
                </label>
                <div className="Captcha"></div>
                <input type="submit" value="Submit" />
            </form>
        )
    
}

export default Form;
